    const int=nameChange[Math.floor(Math.random()*3)];
     setName(nameChange[int]);
  } 
  return (
    <div style={{color:'black',backgroundColor:'pink'}}>
      <p> Basic Concept of React : {name} </p>
    <div style={{color:'black',background:'lightGreen'}}>
    <button onClick={onClickEvent}>Subscribe</button>

    </div><br></br>


    </div>
  )
}

export default Header
